import React from "react";
import classes from "./Hamburger.module.scss";
const Hamburger = () => {
  return (
    <div className={classes.hamburger}>
      <div className={classes.burger} />
      <div className={classes.burger} />
      <div className={classes.burger} />
    </div>
  );
};

export default Hamburger;
